"use strict";
/*! mix.js */Vue.mixin({methods:{upCartCounter:function(t){var e=document.getElementById("cartBtn"),r=document.getElementById("cartTotal");e&&r&&(r.innerText="Cart "+t,t?e.removeAttribute("data-empty"):e.setAttribute("data-empty","true"))},initJsPopup:function(t){for(var e=document.getElementById("fakeJsPopup"),r=0;r<t.length;r++)e.setAttribute(t[r][0],t[r][1]);e.click();for(var n=0;n<t.length;n++)e.removeAttribute(t[n][0])}}});